import React from 'react'; // Import the Component component from React
import ProjectCarousel from './../projectPage/projectCarousel.js'
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'
import Carousel from 'nuka-carousel';

const project_total = "03"

function Home(props) {

  return (
    <ProjectCarousel
      jsx={[<HomepageProject
       projectKey={'panaseer'}
       number="01"
       total={project_total}
       colour="#0FFFB0"
      />,
      <HomepageProject
       projectKey={'joyStory'}
       number="02"
       total={project_total}
       colour="#FF491C"
      />,
      <HomepageProject
       projectKey={'spiro'}
       number="03"
       total={project_total}
       colour="#FFEE1C"
      />
    ]}
    />
  );
}

export default Home;
